import React, { useState } from 'react';

const AIFinancialAnalysis = ({ expenses = [], savings = [] }) => {
  const [aiInsights, setAiInsights] = useState(null);
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState(null);

  const fetchAIAnalysis = async () => {
    setIsLoading(true);
    setError(null);

    // Preparar datos para el análisis
    const totalExpenses = expenses.reduce((sum, exp) => sum + parseFloat(exp.amount || 0), 0);
    const totalSavings = savings.reduce((sum, sav) => sum + parseFloat(sav.current_amount || 0), 0);

    // Calcular gastos por categoría
    const expensesByCategory = {};
    expenses.forEach(exp => {
      if (!expensesByCategory[exp.category]) {
        expensesByCategory[exp.category] = 0;
      }
      expensesByCategory[exp.category] += parseFloat(exp.amount || 0);
    });

    try {
      const response = await fetch('http://localhost:11434/api/generate', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          model: 'llama3.2:3b-instruct-q8_0',
          prompt: `Tu tarea es completar este JSON con datos reales. NO agregues texto adicional ni explicaciones, SOLO devuelve el JSON completo:

{
"gastosTotales": ${totalExpenses},
"ahorrosTotales": ${totalSavings},
"analisisGastos": "Análisis de gastos mensuales por categoría: ${Object.entries(expensesByCategory).map(([cat, amount]) => `${cat}: ${amount}€`).join(', ')}",
"progresoAhorros": "Total ahorrado: ${totalSavings}€",
"recomendaciones": [
"Optimizar gastos en ${Object.keys(expensesByCategory)[0]}",
"Establecer meta de ahorro mensual de ${(totalExpenses * 0.2).toFixed(2)}€",
"Revisar gastos en ${Object.keys(expensesByCategory)[1]}"
],
"categoriasMayorGasto": ${JSON.stringify(Object.keys(expensesByCategory).slice(0, 3))},
"potencialAhorro": ${(totalExpenses * 0.2).toFixed(2)}
}`
        })
      });

      const data = await response.json();
      console.log('Respuesta completa:', data);

      let jsonStr = data.response.trim();

      if (!jsonStr.startsWith('{')) {
        const jsonMatch = jsonStr.match(/\{[\s\S]*\}/);
        if (!jsonMatch) {
          throw new Error('No se encontró un JSON válido en la respuesta');
        }
        jsonStr = jsonMatch[0];
      }

      console.log('JSON a procesar:', jsonStr);
      const jsonObject = JSON.parse(jsonStr);
      setAiInsights(jsonObject);

    } catch (error) {
      console.error('Error completo:', error);
      setError('Error al procesar el análisis. Por favor, intenta de nuevo.');
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div className="p-4 space-y-4">
      <button
        onClick={fetchAIAnalysis}
        disabled={isLoading}
        className={isLoading ? 
          "w-full py-2 px-4 rounded-lg text-white bg-gray-400" : 
          "w-full py-2 px-4 rounded-lg text-white bg-blue-600 hover:bg-blue-700"}
      >
        {isLoading ? "Analizando..." : "Obtener Análisis"}
      </button>

      {error && (
        <div className="p-3 bg-red-50 border border-red-200 rounded-lg text-red-700">
          {error}
        </div>
      )}

      {aiInsights && (
        <div className="space-y-4">
          <div className="grid grid-cols-2 gap-4">
            <div className="p-3 bg-blue-50 rounded-lg">
              <p className="text-sm text-blue-600">Gastos Totales</p>
              <p className="text-xl font-bold">
                {Number(aiInsights.gastosTotales).toLocaleString('es-ES', {
                  style: 'currency',
                  currency: 'EUR'
                })}
              </p>
            </div>
            <div className="p-3 bg-green-50 rounded-lg">
              <p className="text-sm text-green-600">Ahorros Totales</p>
              <p className="text-xl font-bold">
                {Number(aiInsights.ahorrosTotales).toLocaleString('es-ES', {
                  style: 'currency',
                  currency: 'EUR'
                })}
              </p>
            </div>
          </div>

          <div className="space-y-3">
            <div>
              <h3 className="font-medium">Análisis de Gastos</h3>
              <p className="text-gray-700">{aiInsights.analisisGastos}</p>
            </div>

            <div>
              <h3 className="font-medium">Progreso de Ahorros</h3>
              <p className="text-gray-700">{aiInsights.progresoAhorros}</p>
            </div>

            <div>
              <h3 className="font-medium">Categorías con Mayor Gasto</h3>
              <div className="flex gap-2 flex-wrap">
                {aiInsights.categoriasMayorGasto.map((cat, index) => (
                  <span key={index} className="px-2 py-1 bg-gray-100 rounded-full text-sm text-gray-700">
                    {cat}
                  </span>
                ))}
              </div>
            </div>

            <div>
              <h3 className="font-medium">Recomendaciones</h3>
              <div className="space-y-2">
                {aiInsights.recomendaciones.map((rec, index) => (
                  <div key={index} className="flex items-start">
                    <span className="mr-2">•</span>
                    <span className="text-gray-700">{rec}</span>
                  </div>
                ))}
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default AIFinancialAnalysis;
